import Layout from "../components/Layout/layout";
import Head from "next/head"
import Blog from "../components/Blog/blog";
import Link from "next/link"

function HomePage(props) {

    const blog = props.data.data.map((list,index) => {
        return (
            <Link key={index} href="/ooo">
                <Blog   imagelink={list.imagelink} category={list.category} title={list.title} date={list.created}  index={index}  />
            </Link>
        )
      })
   
    return (


      <Layout>
          <Head>
              <title>Blog</title>
              <script src="https://kit.fontawesome.com/a000f9134d.js" crossorigin="anonymous"></script>
          </Head>
           <header className="header">
            <div className="path">
                <a className="link" href="index.html">
                    <h4>
                        Home
                        <div className="underLine"></div>
                    </h4>
                    
                </a>
                <div>
                    <h4>
                       Blog
                        <div className="underLine"></div>
                    </h4>
                   
                </div>
            </div>
            <h1>
               Read Our Blog
            </h1>
            <p>
            A small river named Duden flows by their place and supplies it with the necessary regelialia. It is a paradisematic country, in which roasted parts of sentences fly into your mouth.
            </p>
        </header>
        
        <div className="blog">
            {blog}
        </div>
        
        
       
        <style jsx>{`
            .header{
            
            width:60%;
            padding:60px;
            }
            
            .header > *{
                margin-bottom: 20px;
            }
            
            .path{
                display: flex;
                text-transform: uppercase ;
            }
            
            .header p{
                color:rgb(156, 156, 156);
            }
            
            .link{
                text-decoration:none;
            color:rgb(156, 156, 156);
            margin-right: 15px;
            }
            
            .underLine{
                width: 100%;
                padding: 1px;
                background-color:rgb(156, 156, 156);
            }
            
            .header h1{
                text-transform: capitalize;
                font-weight: 800;
            }

            .blog{
                display:flex;
                flex-direction:row;
                flex-wrap:wrap;
            }

            
        `}</style>
      </Layout>
    )
  }
  
  HomePage.getInitialProps = async function() {
      
   try{
    const res = await fetch('http://edserver.herokuapp.com/api/blog');
    const data = await res.json();
    return {
        data
    }
   }
   catch{
       return data;
   }
}

  export default HomePage
